nter','',1,'2019-10-28 16:25:05'),(216,'CCIT','Computer Channel Interface Test','',1,'2019-10-28 16:25:05'),(217,'CCLAN','Combat Control Local Area Network','CCLAN provides interconnection capability for the various TCS and WCS equipment, including cabling between the Multi Function Server (MFS) cabinets and the workstationss',1,'2019-10-28 16:25:06'),(218,'CCM','Counter-Countermeasures','',1,'2019-10-28 16:25:06'),(219,'CCS','Combat Control System','Subsystem designed to provide fire control for submarine weapon systems.  (i.e. AN/BYG-1) It has three main purposes:  (1) it interacts with other ship systems to detect, identify, classify, and localize surface and submerged targets, (2) upon the decision to attack, it generates weapon orders (torpedo, or CM) necessary to preset and launch the desired weapons, and (3) it provides operator training and system maintenance capabilities.',1,'2019-10-28 16:25:06'),(220,'CCS','Command and Control System','NPES-equivalent for Trident class SSBNs.',1,'2019-10-28 16:25:07'),(221,'CCSM','Command and Control Systems Module','',1,'2019-10-28 16:25:07'),(222,'CCSOT','Command and Control System Operability Test','',1,'2019-10-28 16:25:07'),(223,'CCT','Critical Component Temperature','',1,'2019-10-28 16:25:07'),(224,'CDBDD','Common Data Base Design Document','',1,'2019-10-28 16:25:07'),(225,'CDC','Common Display Console','',1,'2019-10-28 16:25:08'),(226,'CDD','Capability Development Document','The CDD specifies the operational requirements for the system that will deliver the capability that meets operational performance criteria specified in the Initial Capabilities Document (ICD). It outlines a militarily useful increment of capability with its own set of attributes and performance values (i.e., thresholds and objectives).',1,'2019-10-28 16:25:08'),(227,'CDO','Command Duty Officer','In port, a senior line officer (normally a Department Head) reponsible for carrying out the Captain\'s orders for the day.  When the CO is ashore, the 