:30:41'),(928,'TEMP','Test and Evaluation Master Plan','The TEMP describes an acquisition program?s planned T&E activities over a program?s life-cycle and identifies evaluation criteria for the testers. It serves as an executive summary and provides a framework within which to generate detailed T&E plans and documents schedule and resource implications associated with the T&E program. The TEMP identifies and integrates all of the T&E requirements with the program?s Acquisition Strategy and requirements.',1,'2019-10-28 16:30:41'),(929,'TFDS','Time Frequency Distribution System','',1,'2019-10-28 16:30:41'),(930,'TI','Technical Insertion','',1,'2019-10-28 16:30:42'),(931,'TI IPT','Technology Insertion IPT','The TI IPT is a SWFTS enterprise-wide group responsible for the evaluation of new technology that can improve the operational capability of SWFTS subsystems and mitigate technology obsolescence.  ',1,'2019-10-28 16:30:42'),(932,'TIDU','Tagged Input Data Unit','',1,'2019-10-28 16:30:42'),(933,'TIH','Technology Insertion Hardware','',1,'2019-10-28 16:30:42'),(934,'TLAM','Tomahawk Land Attack Missile','',1,'2019-10-28 16:30:42'),(935,'TLCSF','TRIDENT Life Cycle Support Facility','',1,'2019-10-28 16:30:43'),(936,'TLTA','Thin Line Towed Array','',1,'2019-10-28 16:30:43'),(937,'TM','Technical Memorandum','',1,'2019-10-28 16:30:43'),(938,'TMA','Target Motion Analysis','TMA is a process to determine the position of a target using passive sensor information. Sensors like passive RADAR and SONAR provide directional and occasionally frequency information. TMA is done by marking from which direction the sound comes at different times, and comparing the motion with that of the operator\'s own ship. Changes in relative motion are analyzed using standard geometrical techniques along with some assumptions about limiting cases.',1,'2019-10-28 16:30:44'),(939,'TMHK','Tomahawk','',1,'2019-10-28 16:30:44'),(940,'TNS','Tactical Navigation Subsystem','',1,'2019-10-28 16:30:44'),(941,'TOA